import React from "react";
import { Carousel } from "react-responsive-carousel";

export default function RoomListCard({ data }) {
  return (
    <Carousel showThumbs={false} showStatus={false}>
      {data.map((item, index) => (
        <div key={index}>
          <img
            src={item.image}
            alt={`slide-${index}`}
            style={{ width: "200px", height: "400px" }}
          />
          <p>{item.text}</p>
        </div>
      ))}
    </Carousel>
  );
}
